      var lists = [];

      while(i < data.length) {
        lists.push(<li><a href={'/contents/' + data[i].id}>
          {data[i].title}
          </a></li>);
        i = i + 1;

      }
      return (
        <nav>
          <ul>
              <li><a href="1.html">HTML</a></li>
              <li><a href="2.html">CSS</a></li>
              <li><a href="3.html">JavaScript</a></li>
          </ul>
        </nav>
      );
    }
  }

